import React, { useState } from "react";
import {
  AppBar,
  Toolbar,
  IconButton,
  InputBase,
  Typography,
  Box,
  Checkbox,
  TextField,
  Divider,
  Drawer,
  List,
  ListItem,
  ListItemText,
  Container,
  InputAdornment,
} from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";

const SearchBar = () => {
  const [isDrawerOpen, setIsDrawerOpen] = useState(false);
  const [selectedOptions, setSelectedOptions] = useState([]);
  const [minValues, setMinValues] = useState({});
  const [maxValues, setMaxValues] = useState({});

  const handleDrawerOpen = () => {
    setIsDrawerOpen(true);
  };

  const handleDrawerClose = () => {
    setIsDrawerOpen(false);
  };

  const handleOptionToggle = (option) => () => {
    const currentIndex = selectedOptions.indexOf(option);
    const newSelectedOptions = [...selectedOptions];

    if (currentIndex === -1) {
      newSelectedOptions.push(option);
    } else {
      newSelectedOptions.splice(currentIndex, 1);
    }

    setSelectedOptions(newSelectedOptions);
  };

  const handleMinValueChange = (feature) => (event) => {
    setMinValues({ ...minValues, [feature]: event.target.value });
  };

  const handleMaxValueChange = (feature) => (event) => {
    setMaxValues({ ...maxValues, [feature]: event.target.value });
  };

  const handleSearch = () => {
    // Implement your search logic here using selectedOptions, minValues, and maxValues
    console.log("Performing search with selected options:", selectedOptions);
    console.log("Min values:", minValues);
    console.log("Max values:", maxValues);
  };

  return (
    <AppBar position="static">
      <Toolbar>
        <IconButton
          edge="start"
          color="inherit"
          onClick={handleDrawerOpen}
        >
          <SearchIcon />
        </IconButton>
        <InputBase
          onClick={handleDrawerOpen}
          placeholder="Search..."
          sx={{ ml: 1, flex: 1 }}
        />
        <IconButton color="inherit" onClick={handleSearch}>
          <SearchIcon />
        </IconButton>
      </Toolbar>
      <Drawer
        anchor="bottom"
        open={isDrawerOpen}
        onClose={handleDrawerClose}
      >
        <Container>
          <Box sx={{
            p: 1,
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-between"
          }}>
          <Box sx={{ 
            display: "flex",
						flexDirection: "column"}}>
            <Typography variant="h6" gutterBottom>
              Deal Opportunity:
            </Typography>
            <List>
              {["Early", "Growth", "Buyout"].map((option) => (
                <ListItem
                  key={option}
                  button
                  onClick={handleOptionToggle(option)}
                >
                  <Checkbox
                    checked={selectedOptions.indexOf(option) !== -1}
                  />
                  <ListItemText primary={option} />
                </ListItem>
              ))}
            </List>
          </Box>
          <Box sx={{ 
            display: "flex",
						flexDirection: "column"}}>
            <Typography variant="h6" gutterBottom>
              Founding Year:
            </Typography>
            <TextField
              label="Year (Min)"
              type="number"
              value={minValues.feature1 || ""}
              onChange={handleMinValueChange("feature1")}
              sx={{ mb: 2 }}
            />
            <TextField
              label="Year (Max)"
              type="number"
              value={maxValues.feature1 || ""}
              onChange={handleMaxValueChange("feature1")}
              sx={{ mb: 2 }}
            />
          </Box>
          <Box sx={{ 
            display: "flex",
						flexDirection: "column"}}>
            <Typography variant="h6" gutterBottom>
              # of Employees:
            </Typography>
            <TextField
              label="Employees (Min)"
              type="number"
              value={minValues.feature2 || ""}
              onChange={handleMinValueChange("feature1")}
              sx={{ mb: 2 }}
            />
            <TextField
              label="Employees (Max)"
              type="number"
              value={maxValues.feature2 || ""}
              onChange={handleMaxValueChange("feature1")}
              sx={{ mb: 2 }}
            />
          </Box>
          <Box sx={{ 
            display: "flex",
						flexDirection: "column"}}>
            <Typography variant="h6" gutterBottom>
              YoY Employee Growth:
            </Typography>
            <TextField
              label="Growth (Min)"
              type="number"
              value={minValues.feature2 !== null ? `${minValues.feature2}%` : ""}
              onChange={handleMinValueChange("feature2")}
              InputProps={{
                endAdornment: <InputAdornment position="end">%</InputAdornment>,
              }}
              sx={{ mb: 2 }}
            />
            <TextField
              label="Growth (Max)"
              type="number"
              value={maxValues.feature2 !== null ? `${maxValues.feature2}%` : ""}
              onChange={handleMaxValueChange("feature2")}
              InputProps={{
                endAdornment: <InputAdornment position="end">%</InputAdornment>,
              }}
              sx={{ mb: 2 }}
            />
          </Box>
          </Box>
          <Divider />
          <Box sx={{
            p: 1,
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-between"
          }}>
          <Box sx={{ 
            display: "flex",
						flexDirection: "column"}}>
            <Typography variant="h6" gutterBottom>
              Total Raised-to-Date (USD$M):
            </Typography>
            <TextField
              label="Amount (Min)"
              type="number"
              value={minValues.feature1 || ""}
              onChange={handleMinValueChange("feature1")}
              sx={{ mb: 2 }}
            />
            <TextField
              label="Amount (Max)"
              type="number"
              value={maxValues.feature1 || ""}
              onChange={handleMaxValueChange("feature1")}
              sx={{ mb: 2 }}
            />
          </Box>
          <Box sx={{ 
            display: "flex",
						flexDirection: "column"}}>
            <Typography variant="h6" gutterBottom>
              Total Raised-to-Date (USD$M):
            </Typography>
            <TextField
              label="Amount (Min)"
              type="number"
              value={minValues.feature1 || ""}
              onChange={handleMinValueChange("feature1")}
              sx={{ mb: 2 }}
            />
            <TextField
              label="Amount (Max)"
              type="number"
              value={maxValues.feature1 || ""}
              onChange={handleMaxValueChange("feature1")}
              sx={{ mb: 2 }}
            />
          </Box>
          <Box sx={{ 
            display: "flex",
						flexDirection: "column"}}>
            <Typography variant="h6" gutterBottom>
              Last Round Amount (USD$M):
            </Typography>
            <TextField
              label="Amount (Min)"
              type="number"
              value={minValues.feature2 || ""}
              onChange={handleMinValueChange("feature1")}
              sx={{ mb: 2 }}
            />
            <TextField
              label="Amount (Max)"
              type="number"
              value={maxValues.feature2 || ""}
              onChange={handleMaxValueChange("feature1")}
              sx={{ mb: 2 }}
            />
          </Box>
          </Box>
        </Container>
      </Drawer>
    </AppBar>
  );
};

export default SearchBar;
